import React, { Component } from 'react';

class Nash extends Component {
	render() {
		return (
			<div className=" col-md-4 col-sm-6">
				<div className="card">
					<div className="card-body">
						<img src={this.props.img} />
					</div>
				</div>
			</div>
		);
	}
}
export default Nash;
